    setBuscarProd(event.target.value);
  };

  return (
    <div className="app">
      <header className="header">
        <div className="app-name">SixHearts</div>
        <div className="header-buttons">
          <div className="header-buttons-left">
            <div className="header-button-dark">Inicio</div>
            <div className="header-button-dark">Sneakers</div>
          </div>
