            <input
              type="text"
              value={buscarProd}
              onChange={handleBuscarProdChange}
              className="search-input"
              placeholder="Buscar . . ."
            />
            <button className="header-button" onClick={handleBuscarProdClick}>
              Buscar
            </button>
          </div>
        </div>
      </header>
      <main className="main-content">
        {/* Aquí puedes agregar el contenido principal de tu página */}
      </main>
    </div>
  );
}

export default App;
